import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import ExcelAnnotationApp from '../components/excel';
import samplePayload from '../components/excel/payload';
import { AnnotationType } from '../types';

const Excel: React.FC = withConnect({ type: AnnotationType.EXCEL, samplePayload })(ExcelAnnotationApp);

ReactDOM.render(
  <Excel />,
  document.getElementById('root'),
);

serviceWorker.unregister();
